@-moz-document url-prefix("https://scratch.mit.edu/discuss/topic") {
.post_body_html blockquote {
    overflow: hidden;
}
.post_body_html > blockquote > blockquote > blockquote {
    max-height: 50px;
    transition: all 0.5s;
}
.post_body_html > blockquote > blockquote > blockquote blockquote {
    opacity: 0.7;
}
.post_body_html > blockquote > blockquote > blockquote:not(:hover) > p::after {
    content: " (Hover to expand)";
}
.post_body_html > blockquote > blockquote > blockquote:hover,
.post_body_html > blockquote > blockquote > blockquote:hover * {
    height: auto;
    max-height: 5000px;
    opacity: 1;
}
.code { background-color: #eaeaea; }
.postsignature > span:not(:hover), .post_body_html > span:not(:hover), .postsignature blockquote > span:not(:hover), .post_body_html blockquote > span:not(:hover) {
    color: inherit;
    background-color: inherit;
    transition: all 0.5s;
}
.postsignature > span:hover, .postsignature > span:hover *, .post_body_html > span:hover, .post_body_html > span:hover *, .postsignature blockquote > span:hover, .postsignature blockquote > span:hover *, .post_body_html blockquote > span:hover, .post_body_html blockquote > span:hover * {
    background-color: #000 !important;
    color: #fff !important;
    transition: all 0.5s;
    padding: 2px 0px !important;
    -webkit-border-radius: 3px !important;
    border-radius: 3px !important;
}
.postsignature:not(:hover)::before { content:"(hover to show)"; display: block; font-weight: bold; }
.postsignature { border: 1px solid #ccc !important; overflow: hidden; }
.postsignature > hr { display: none; }
.postsignature:not(:hover) { transition: all 0.5s; max-height: 40px !important; }
.postsignature:hover { transition: all 0.5s; max-height: 168px !important; }
}

@-moz-document url-prefix("https://scratch.mit.edu") {
#topnav .innerwrap {
	background-color: #FAB55A;
}
#topnav .container > ul > li {
	border-left: none !important;
    border-right: none !important;
}
#topnav .container li:hover {
    background-color: #C48D46 !important;
}
#topnav ul.account-nav .logged-in-user.dropdown.open { background-color: #C48D46 !important; }
#topnav ul.account-nav>li.sign-in.open { background-color: #C48D46 !important; }
#topnav ul.account-nav .logged-in-user .dropdown-menu { background-color: #FAB55A !important; border: none !important; }
#topnav ul.account-nav .logged-in-user .dropdown-menu li { border: none !important; }
#topnav ul.account-nav .sign-in .popover { background-color: #FAB55A !important; border: none !important; }
#topnav ul.account-nav .sign-in .popover *:not(button):not(input) { color: #fff !important; border: none !important; }
#topnav ul.account-nav .sign-in .popover .arrow { display:none; }
html, body {
	background-image: none !important;
    background-color: #fafafa;
}
.box-head, .box {
	background-color: #FAB55A !important;
    border: none !important;
}
.box-head h1, .box-head h2, .box-head h3, .box-head h4 { color: #fff !important; text-shadow: 0 1px #F9C784; }
.box.v-tabs {
	background-color: #fff !important;
    border: none !important;
}
.v-tabs li>a { color: #000 !important; }
.v-tabs li.active>a { color: #fff !important; }
.box-head a { color: #fff !important; }
.box-head .button.grey { color: #666 !important; }
.h-tabs>li:not(.active)>a { color: #fff !important; }
.h-tabs>li:not(.active):hover>a { color: #000 !important; background-color: #fff; border-bottom: 2px solid #fff !important; }
.h-tabs>li>a { color: #000 !important; }
.actionbar { border: none !important; }
* {
	-webkit-border-radius: 5px !important;
    border-radius: 5px !important;
    text-shadow: none;
}
.avatar {
	-webkit-border-radius: 50% !important;
    border-radius: 50% !important;
}
.user-icon {
	-webkit-border-radius: 50% !important;
    border-radius: 50% !important;
}
#search-input {
	-webkit-border-radius: 10px !important;
    border-radius: 10px !important;
    transition: all 0.5s;
}
.notificationsCount {
	-webkit-border-radius: 10px !important;
    border-radius: 10px !important;
    background-color: #299EFF !important;
}
#search-input:not(:focus) {
    width: 50% !important;
}
#search-input:focus {
    width: calc(100% - 12px);
}
.site-nav li:nth-child(4), .site-nav li:nth-child(5) {
    display: none !important;
}
:not(button):not(.button) > a:not(button):not(.button), :not(button):not(.button) > input.link:not(button):not(.button), :not(button):not(.button) > a:hover:not(button):not(.button), :not(button):not(.button) > input.link:hover:not(button):not(.button) {
	color: #FF9C1C;
}
.closed-topic a, .closed-topic a:hover {
	color: #888 !important;
}
.ajax-loader, #comments-loading { background-image: url(data:image/gif;base64,) !important; }
#topnav ul.account-nav .my-stuff .mystuff-icon { background: url(data:image/png;base64,) no-repeat center center;}
.inew { background-image: url(data:image/png;base64,);}
.isticky { background-image: url(data:image/png;base64,);}
#topnav .logo span { background: url(data:image/png;base64,) no-repeat left center !important; }
#topnav .logo:hover span { background: url(data:image/png;base64,) no-repeat left center !important;}
}

@-moz-document url-prefix("https://scratch.mit.edu") {
.sb2 .stack,
.sb2 .cap,
.sb2 .outline {
  border-radius: 5px !important;
  -webkit-border-radius: 5px !important;
  -moz-border-radius: 5px !important;
}
.sb2 .stack:before,
.sb2 .cap:before {
  border-radius: 0 0 4px 4px !important;
  -webkit-border-radius: 0 0 4px 4px !important;
  -moz-border-radius: 0 0 4px 4px !important;
}
.sb2 .stack:after,
.sb2 .hat:after,
.sb2 .define-hat:after {
  border-radius: 0 0 3px 3px !important;
  -webkit-border-radius: 0 0 3px 3px !important;
  -moz-border-radius: 0 0 3px 3px !important;
}
.sb2 .hat,
.sb2 .define-hat {
  border-radius: 0 5px 5px 5px !important;
  -webkit-border-radius: 0 5px 5px 5px !important;
  -moz-border-radius: 0 5px 5px 5px !important;
}
.sb2 .hat:before,
.sb2 .define-hat:before {
  border-radius: 40px 40px 0 0 / 13px 13px 0 0 !important;
  -webkit-border-radius: 40px 40px 0 0 / 13px 13px 0 0 !important;
  -moz-border-radius: 40px 40px 0 0 / 13px 13px 0 0 !important;
}
.sb2 .define-hat {
  border-radius: 0 0 5px 5px !important;
  -webkit-border-radius: 0 0 5px 5px !important;
  -moz-border-radius: 0 0 5px 5px !important;
}
.sb2 .define-hat:before {
  border-radius: 50% 50% 3px 3px / 16px 16px 3px 3px !important;
  -webkit-border-radius: 50% 50% 3px 3px / 16px 16px 3px 3px !important;
  -moz-border-radius: 50% 50% 3px 3px / 16px 16px 3px 3px !important;
}
.sb2 .outline:before,
.sb2 .outline:after {
  border-radius: 0 0 4px 4px !important;
  -webkit-border-radius: 0 0 4px 4px !important;
  -moz-border-radius: 0 0 4px 4px !important;
}
.sb2 .cwrap .cstart {
  border-radius: 4px 4px 4px 0 !important;
  -webkit-border-radius: 4px 4px 4px 0 !important;
  -moz-border-radius: 4px 4px 4px 0 !important;
}
.sb2 .cwrap .celse {
  border-radius: 0 4px 4px 0 !important;
  -webkit-border-radius: 0 4px 4px 0 !important;
  -moz-border-radius: 0 4px 4px 0 !important;
}
.sb2 .cwrap .cend {
  border-radius: 0 4px 4px 4px !important;
  -webkit-border-radius: 0 4px 4px 4px !important;
  -moz-border-radius: 0 4px 4px 4px !important;
}
.sb2 .number,
.sb2 .number-dropdown {
  border-radius: 10px !important;
}
.sb2 .dropdown:after,
.sb2 .number-dropdown:after {
  border-radius: 2px !important;
  -webkit-border-radius: 2px !important;
  -moz-border-radius: 2px !important;
}
.sb2 .reporter,
.sb2 .embedded {
  border-radius: 2000px !important;
  -webkit-border-radius: 2000px !important;
  -moz-border-radius: 2000px !important;
}

.sb2 .boolean {
  border-radius: 25% !important;
  -webkit-border-radius: 25% !important;
  -moz-border-radius: 25% !important;
}

.sb2 .comment div {
  border-radius: 4px !important;
  -webkit-border-radius: 4px !important;
  -moz-border-radius: 4px !important;
}
.sb2 .ring-inner:before {
  border-radius: 0 0 3px 3px !important;
}
.sb2 .ring {
  border-radius: 11px !important;
}

.sb2 .dropdown, .sb2 .string, .sb2 .color { border-radius: 0px !important; }
}
